import React, { useState } from 'react';

const ProfileScreen: React.FC = () => {
  const [activeTab, setActiveTab] = useState('activity');

  // Mock user data
  const userData = {
    name: 'Sophia Chen',
    username: '@sophiastyle',
    bio: 'Fashion enthusiast | Fitness lover | Always on the lookout for the next trend',
    followers: 1248,
    following: 356,
    posts: 42,
    location: 'New York, USA',
    memberSince: 'March 2023',
    profileImage: 'https://readdy.ai/api/search-image?query=Professional%20portrait%20of%20a%20stylish%20young%20woman%20with%20short%20dark%20hair%2C%20natural%20makeup%2C%20fashion%20model%20aesthetic%2C%20high%20quality%2C%20photorealistic%2C%20soft%20lighting%2C%20studio%20shot%2C%20isolated%20on%20dark%20background%2C%20centered%20composition&width=150&height=150&seq=user1&orientation=squarish',
    coverImage: 'https://readdy.ai/api/search-image?query=Abstract%20gradient%20background%20with%20pink%20to%20cyan%20colors%2C%20modern%20design%2C%20digital%20art%2C%20smooth%20transitions%2C%20futuristic%20aesthetic%2C%20high%20quality&width=375&height=150&seq=cover1&orientation=landscape'
  };

  // Mock activity data
  const activityData = [
    { type: 'purchase', item: 'Neon Oversized Hoodie', date: '2 days ago', image: 'https://readdy.ai/api/search-image?query=Stylish%20oversized%20hoodie%20in%20neon%20colors%2C%20fashion%20item%20on%20dark%20background%2C%20product%20photography%2C%20high%20quality&width=80&height=80&seq=item1&orientation=squarish' },
    { type: 'favorite', item: 'Cyber Runner Sneakers', date: '5 days ago', image: 'https://readdy.ai/api/search-image?query=Futuristic%20sneakers%20with%20neon%20accents%2C%20fashion%20item%20on%20dark%20background%2C%20product%20photography%2C%20high%20quality&width=80&height=80&seq=item2&orientation=squarish' },
    { type: 'review', item: 'Tech Cargo Pants', date: '1 week ago', image: 'https://readdy.ai/api/search-image?query=Modern%20cargo%20pants%20with%20technical%20details%2C%20fashion%20item%20on%20dark%20background%2C%20product%20photography%2C%20high%20quality&width=80&height=80&seq=item3&orientation=squarish' },
    { type: 'purchase', item: 'Gradient Mesh Top', date: '2 weeks ago', image: 'https://readdy.ai/api/search-image?query=Stylish%20mesh%20top%20with%20gradient%20colors%2C%20fashion%20item%20on%20dark%20background%2C%20product%20photography%2C%20high%20quality&width=80&height=80&seq=item4&orientation=squarish' },
  ];

  // Mock collection data
  const collectionData = [
    { name: 'Summer Favorites', items: 12, image: 'https://readdy.ai/api/search-image?query=Summer%20fashion%20collection%20with%20bright%20colors%2C%20stylish%20arrangement%20of%20clothing%20items%2C%20professional%20fashion%20photography%2C%20high%20quality&width=150&height=150&seq=coll1&orientation=squarish' },
    { name: 'Workout Gear', items: 8, image: 'https://readdy.ai/api/search-image?query=Athletic%20workout%20clothing%20collection%2C%20stylish%20arrangement%20of%20fitness%20items%2C%20professional%20fashion%20photography%2C%20high%20quality&width=150&height=150&seq=coll2&orientation=squarish' },
    { name: 'Night Out', items: 15, image: 'https://readdy.ai/api/search-image?query=Elegant%20evening%20wear%20collection%2C%20stylish%20arrangement%20of%20fashion%20items%2C%20professional%20fashion%20photography%2C%20high%20quality&width=150&height=150&seq=coll3&orientation=squarish' },
  ];

  // Mock settings options
  const settingsOptions = [
    { icon: 'fa-user', label: 'Edit Profile' },
    { icon: 'fa-bell', label: 'Notifications' },
    { icon: 'fa-lock', label: 'Privacy & Security' },
    { icon: 'fa-credit-card', label: 'Payment Methods' },
    { icon: 'fa-map-marker-alt', label: 'Addresses' },
    { icon: 'fa-question-circle', label: 'Help & Support' },
    { icon: 'fa-sign-out-alt', label: 'Log Out' },
  ];

  // Render activity item
  const renderActivityItem = (item: any, index: number) => {
    const getIcon = () => {
      switch (item.type) {
        case 'purchase': return 'fa-shopping-bag';
        case 'favorite': return 'fa-heart';
        case 'review': return 'fa-star';
        default: return 'fa-circle';
      }
    };

    const getLabel = () => {
      switch (item.type) {
        case 'purchase': return 'Purchased';
        case 'favorite': return 'Added to favorites';
        case 'review': return 'Reviewed';
        default: return 'Interacted with';
      }
    };

    return (
      <div key={index} className="flex items-center p-3 rounded-xl bg-white/5 backdrop-blur-sm mb-3">
        <div className="w-16 h-16 rounded-xl overflow-hidden mr-3 bg-white/10">
          <img src={item.image} alt={item.item} className="w-full h-full object-cover" />
        </div>
        <div className="flex-1">
          <div className="flex items-center mb-1">
            <div className={`w-6 h-6 rounded-full flex items-center justify-center mr-2 ${
              item.type === 'purchase' ? 'bg-[#00F5FF]/20 text-[#00F5FF]' : 
              item.type === 'favorite' ? 'bg-[#FF2E63]/20 text-[#FF2E63]' : 
              'bg-[#FFD700]/20 text-[#FFD700]'
            }`}>
              <i className={`fas ${getIcon()} text-xs`}></i>
            </div>
            <span className="text-xs text-white/60">{getLabel()}</span>
          </div>
          <h4 className="text-sm font-medium">{item.item}</h4>
          <div className="flex items-center mt-1">
            <i className="fas fa-clock text-xs text-white/40 mr-1"></i>
            <span className="text-xs text-white/40">{item.date}</span>
          </div>
        </div>
      </div>
    );
  };

  return (
    <div className="pb-4">
      {/* Cover Photo */}
      <div className="relative h-36 mb-16">
        <img 
          src={userData.coverImage} 
          alt="Cover" 
          className="w-full h-full object-cover"
        />
        <div className="absolute -bottom-12 left-1/2 transform -translate-x-1/2 w-24 h-24 rounded-full border-4 border-[#121214] overflow-hidden">
          <img 
            src={userData.profileImage} 
            alt="Profile" 
            className="w-full h-full object-cover"
          />
        </div>
      </div>

      {/* User Info */}
      <div className="text-center px-4 mb-6">
        <h2 className="text-xl font-bold mb-1">{userData.name}</h2>
        <p className="text-[#00F5FF] text-sm mb-2">{userData.username}</p>
        <p className="text-white/60 text-sm mb-4">{userData.bio}</p>

        {/* Stats */}
        <div className="flex justify-center space-x-6 mb-4">
          <div className="text-center">
            <p className="text-lg font-bold bg-gradient-to-r from-[#FF2E63] to-[#00F5FF] bg-clip-text text-transparent">{userData.posts}</p>
            <p className="text-xs text-white/60">Posts</p>
          </div>
          <div className="text-center">
            <p className="text-lg font-bold bg-gradient-to-r from-[#FF2E63] to-[#00F5FF] bg-clip-text text-transparent">{userData.followers}</p>
            <p className="text-xs text-white/60">Followers</p>
          </div>
          <div className="text-center">
            <p className="text-lg font-bold bg-gradient-to-r from-[#FF2E63] to-[#00F5FF] bg-clip-text text-transparent">{userData.following}</p>
            <p className="text-xs text-white/60">Following</p>
          </div>
        </div>

        {/* Edit Profile Button */}
        <button className="bg-white/10 backdrop-blur-sm text-white px-4 py-2 rounded-full text-sm font-medium hover:bg-white/20 transition-colors">
          Edit Profile
        </button>
      </div>

      {/* Tabs */}
      <div className="border-b border-white/10 mb-4">
        <div className="flex px-4">
          {['activity', 'collections', 'settings'].map((tab) => (
            <button
              key={tab}
              onClick={() => setActiveTab(tab)}
              className={`px-4 py-3 text-sm font-medium relative ${activeTab === tab ? 'text-white' : 'text-white/40'}`}
            >
              {tab.charAt(0).toUpperCase() + tab.slice(1)}
              {activeTab === tab && (
                <div className="absolute bottom-0 left-0 w-full h-0.5 bg-gradient-to-r from-[#FF2E63] to-[#00F5FF]"></div>
              )}
            </button>
          ))}
        </div>
      </div>

      {/* Tab Content */}
      <div className="px-4">
        {/* Activity Tab */}
        {activeTab === 'activity' && (
          <div>
            <div className="mb-4">
              <h3 className="text-lg font-semibold mb-3">Recent Activity</h3>
              {activityData.map((item, index) => renderActivityItem(item, index))}
            </div>
          </div>
        )}

        {/* Collections Tab */}
        {activeTab === 'collections' && (
          <div>
            <div className="mb-4">
              <h3 className="text-lg font-semibold mb-3">Your Collections</h3>
              <div className="grid grid-cols-2 gap-4">
                {collectionData.map((collection, index) => (
                  <div key={index} className="rounded-2xl bg-white/5 backdrop-blur-sm overflow-hidden cursor-pointer">
                    <div className="h-36 overflow-hidden">
                      <img src={collection.image} alt={collection.name} className="w-full h-full object-cover" />
                    </div>
                    <div className="p-3">
                      <h4 className="text-sm font-medium mb-1">{collection.name}</h4>
                      <p className="text-xs text-white/60">{collection.items} items</p>
                    </div>
                  </div>
                ))}

                {/* Add New Collection */}
                <div className="rounded-2xl border-2 border-dashed border-white/20 flex flex-col items-center justify-center h-48 cursor-pointer">
                  <div className="w-12 h-12 rounded-full bg-white/10 flex items-center justify-center mb-2">
                    <i className="fas fa-plus text-[#00F5FF]"></i>
                  </div>
                  <p className="text-sm text-white/60">Create Collection</p>
                </div>
              </div>
            </div>
          </div>
        )}

        {/* Settings Tab */}
        {activeTab === 'settings' && (
          <div>
            <div className="mb-4">
              <h3 className="text-lg font-semibold mb-3">Account Settings</h3>
              <div className="rounded-2xl bg-white/5 backdrop-blur-sm overflow-hidden">
                {settingsOptions.map((option, index) => (
                  <div key={index} className={`flex items-center justify-between p-4 cursor-pointer hover:bg-white/10 ${index !== settingsOptions.length - 1 ? 'border-b border-white/10' : ''}`}>
                    <div className="flex items-center">
                      <div className="w-8 h-8 rounded-full bg-white/10 flex items-center justify-center mr-3">
                        <i className={`fas ${option.icon} text-white/80`}></i>
                      </div>
                      <span className="text-sm">{option.label}</span>
                    </div>
                    <i className="fas fa-chevron-right text-white/40"></i>
                  </div>
                ))}
              </div>
            </div>

            {/* User Info */}
            <div className="mb-4">
              <h3 className="text-lg font-semibold mb-3">About</h3>
              <div className="rounded-2xl bg-white/5 backdrop-blur-sm p-4">
                <div className="flex items-center mb-3">
                  <div className="w-8 h-8 rounded-full bg-white/10 flex items-center justify-center mr-3">
                    <i className="fas fa-map-marker-alt text-[#FF2E63]"></i>
                  </div>
                  <div>
                    <p className="text-xs text-white/40">Location</p>
                    <p className="text-sm">{userData.location}</p>
                  </div>
                </div>
                <div className="flex items-center">
                  <div className="w-8 h-8 rounded-full bg-white/10 flex items-center justify-center mr-3">
                    <i className="fas fa-calendar-alt text-[#00F5FF]"></i>
                  </div>
                  <div>
                    <p className="text-xs text-white/40">Member Since</p>
                    <p className="text-sm">{userData.memberSince}</p>
                  </div>
                </div>
              </div>
            </div>

            {/* App Version */}
            <div className="text-center text-xs text-white/40 mt-6">
              <p>FlashFit v1.0.0</p>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default ProfileScreen;
